import React from "react";
import './phones.css'

const Mobile = ({mobiles}) => {
  return (
      <div>
          <h1>List of available phones</h1>
          {mobiles.map((x) => (
                  <div class="mobiles">
                      <h2>{x.id}</h2>
                      <h2>{x.name}</h2>
                      <h2>{x.manufacturer}</h2>
                  </div>
          ))}
      </div>

  )
};

export default Mobile
